INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (100, "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 3001, 0.0, 2, 2.1, -416.5, "ヤマト", "2024/10/31 12:00:00", 3001100, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (101, "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 3001, 0.0, 2, 5.68, -416.5, "ヤマト", "2024/10/31 12:00:00", 3001101, 4);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (102, "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 3001, 0.0, 1, 0.0, -416.5, "ヤマト", "2024/10/31 12:00:00", 3001102, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (100, "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 3002, 0.0, 1, 0.0, -416.5, "フブキ", "2024/10/31 12:00:00", 3002100, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (101, "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 3002, 0.0, 1, 0.0, -416.5, "フブキ", "2024/10/31 12:00:00", 3002101, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (102, "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 3002, 0.0, 2, 8.53, -416.5, "フブキ", "2024/10/31 12:00:00", 3002102, 5);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (103, "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 3002, 0.0, 1, 5.67, -416.5, "フブキ", "2024/10/31 12:00:00", 3002103, 7);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (104, "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 3002, 0.0, 1, 0.0, -416.5, "フブキ", "2024/10/31 12:00:00", 3002104, 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (300, "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 3004, 0.0, 3, 0.0, -416.5, "フブキ", "2024/10/31 12:00:00", 3002300, 3);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (301, "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 3005, 0.0, 7, 0.0, -416.5, "フブキ", "2024/10/31 12:00:00", 3002400, 7);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (200, "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 3003, 0.0, 1, 4.4, -416.5, "フブキ", "2024/10/31 12:00:00", 3003200, 2);
